import React, { useState } from "react";

const MyList = () => {
  // Sample property data
  const [cart, setCart] = useState([
    {
      id: 1,
      title: "Luxury Villa in LA",
      price: "$1,200,000",
      image: "https://via.placeholder.com/150",
    },
    {
      id: 2,
      title: "Modern Apartment in NYC",
      price: "$850,000",
      image: "https://via.placeholder.com/150",
    },
    {
      id: 3,
      title: "Beach House in Miami",
      price: "$1,500,000",
      image: "https://via.placeholder.com/150",
    },
  ]);

  // Remove property from cart
  const removeFromCart = (id) => {
    setCart(cart.filter((item) => item.id !== id));
  };

  return (
    <div className="cart-container">
      <h2>My Saved Properties</h2>
      {cart.length === 0 ? (
        <p>No properties in your list.</p>
      ) : (
        <div className="property-list">
          {cart.map((property) => (
            <div key={property.id} className="property-card">
              <img src={property.image} alt={property.title} />
              <h3>{property.title}</h3>
              <p>{property.price}</p>
              <button onClick={() => removeFromCart(property.id)}>Remove</button>
            </div>
          ))}
        </div>
      )}
    </div>
  );
};

export default MyList;
